import './index.css';

export default function InputSelectionButton({onBtnClick}) {
  return (
    <div className="input-selection-button">
      <button onClick={onBtnClick}></button>
      <img 
     src={"./grapefruit.jpg"}
     alt="Grapefruit slice atop a pile of other slices"></img>
    </div>
  );
}
